import React from 'react';
import Navbar from '../Navbar/Navbar';
import Main from '../Main/Main';

const landing = ( props ) => {
    return (
        <div>
            <div>
               <Navbar></Navbar>
            </div>
            <div>
               <Main></Main>
        </div>
        </div>
    );
};

export default landing;
